from typing import List
import time

class Solution:
    def findSmallestSetOfVertices(self, n: int, edges: List[List[int]]) -> List[int]:
        global t 
        in_result = [True]*n
        adj_table = [set() for i in range(n)]
        for x,y in edges:
            adj_table[x].add(y)
            if (in_result[y]):
                in_result[y] = False
        # print(adj_table)
        chosedNode_v2 = set()
        for i in range(n):
            if in_result[i]:
                chosedNode_v2.add(i)    
        # print(chosedNode_v2)
        print("read input:", t-time.time())
        
        reachedNode = [{i} for i in range(n)]
        maxL = 0
        for i in range(n):
            # if (in_result[i] == False):
            #     continue
            trace = [True]*n
            trace[i] = True
            stack = [i]
            while len(stack)>0:
                last = stack.pop()
                if (trace[last]):
                    stack += adj_table[last]
                    trace[last] = False
                    reachedNode[i].add(last)
            if len(reachedNode[maxL]) < len(reachedNode[i]):
                maxL = i
        print("created reachedNode:",t-time.time())

        # print(maxL)
        # print(adj_table)
        # print(reachedNode)
        chosedNode = set()
        while len(reachedNode[maxL])!= 0:
            chosedNode.add(maxL)
            tmp = set()
            tmp = tmp.union(reachedNode[maxL])
            maxL = 0
            for i in range(n):
                reachedNode[i] = reachedNode[i] - tmp
                if len(reachedNode[maxL]) < len(reachedNode[i]):
                    maxL = i
            
        print("union node:",t-time.time())
                
        # print(reachedNode)
        print(chosedNode_v2 - chosedNode)
        return chosedNode
   
   
    
